import React from "react";
import { useNavigate } from "react-router-dom";

const Home = (props) => {
  const navigate = useNavigate();

  return (
    <div style={{ display: "flex", flexDirection: "column", alignItems: "center" }}>
      <h1>Home Page</h1>
      <p>Go to the contact page by using one of the following:</p>
      <hr />

      {/* Buttons */}
      <div style={{ display: "flex", flexDirection: "column", alignItems: "center" }}>
        <button onClick={() => navigate("/services")}>Mint Token</button>
        <button onClick={() => navigate("/sell")}>Sell an Item</button>
        <button onClick={() => navigate("/about")}>List all items for sale</button>
        <button onClick={() => navigate("/blog")}>Change price of an item</button>
      </div>
    </div>
  );
};

export default Home;
